import{_ as t,c as e,o as p,a as _}from"./app.5b22e94d.js";const u=JSON.parse('{"title":"5月10日记","description":"","frontmatter":{"title":"5月10日记","date":"2023-05-10T00:00:00.000Z","draft":false},"headers":[],"relativePath":"note/2023/20230510.md"}'),a={name:"note/2023/20230510.md"},o=_("<p>今天是很平淡的一天，上午找bug，找了一上午，没有修复，下午继续找，换了个思路，然后找到了，最后修复了。</p><p>下午一开始我们两个都在找，找了一会，我决定先把早上要做的事情做了，那个相对简单一点，大概花了一个多小时，然后完成了。</p><p>然后专心的找bug，结果没过多久就找到了，因为版本变更，所以用法变了，还是在官方论坛找到的资料。</p><p>怎么说呢？确实有点难找，不过找到了还好。</p><p>找完了以后，我又开始弄小程序的事情，发现有点陌生了，对于自己以前写的代码，不过稍微熟悉一下之后，就可以上手了。</p><p>新增了一个简单的功能，然后就没有然后了，六点过我就回来了。</p><p>我妈妈给我寄的锅子到了，把饭煮着，到楼下买了一个勺子，和一瓶下饭菜，应该够我吃好几天了，我觉得。</p><p>小狗今天不太活跃，估计是昨天吃多了，或者受凉了，牛奶也不喝，狗粮也不迟，也不爱跟我了，我估计它肯定身体不舒服，不过我只要叫它，它还是会起来，到我身边，我就摸摸它的头，它使劲把头往上翘，我感觉多摸几次，它肯定就秃了。</p><p>刚才给它喝了一点营养快线，也没喝多少，看了还是没有食欲，如果明天还没有好转的话，我就要往宠物医院跑，或者找点药物了。</p><p>一会给它弄点稀饭吃吃，希望它尽快好起来吧。</p><p>对了，今天天气其实还不错的，上午是阴天，下午就是大太阳，照的一切都很明亮，特别是下午五六点的时候，折射的光线都有点耀眼。</p><p>我好久没有骑车了，有好几天吧，自从小狗回来了，我都没有骑过车了。我意识到一个问题，那就是我好像没有很多的时间陪它和照顾它，也许我当初买回来是一个错误的选择，不过既然已经买回来了，先看一段时间吧，如果实在不行，只好让别人领养，或者送回老家去了。</p>",12),s=[o];function n(r,c,d,i,l,f){return p(),e("div",null,s)}const T=t(a,[["render",n]]);export{u as __pageData,T as default};
